from multiprocessing import Processfrom bs4 import BeautifulSoupimport requestsimport timedef insta_sccrape(name: str):    try:        html = requests.get(f'https://www.instagram.com/{name}/')        soup = BeautifulSoup(html.text, 'html.parser')        url = soup.select_one("meta[property='og:description']")        name = url.find_previous_sibling().get("content").split("â€¢")[0]        followers = url.get("content").split(",")[0]        following = url.get("content").split(",")[1]        post = url.get("content").split(",")[2]        return f'UserName: {name}\nFollowers: {followers}\nFollowing: {following}\nPosts: {post}'    except AttributeError:        raise "Siz 'username'ni yozishda xato qildingiz!"start = time.time()print(insta_sccrape('subyektivuz'))end = time.time()print(f'Funksiya {(end - start):.5f} vaqt davomida ishladi\n\n')# xato username# start = time.time()# print(insta_sccrape('sodiq_schools'))# end = time.time()# print(f'Funksiya {(end - start):.5f} vaqt davomida ishladi\n\n')start = time.time()print(insta_sccrape('sodiq_school'))end = time.time()print(f'Funksiya {(end - start):.5f} vaqt davomida ishladi\n\n')# Subyektivuz -> 2.355 vaqt davomida ishladi# sodiq_school ->  2.057 vaqt davomida ishladiif __name__ == "__main__":    print('Parallelizm ishni boshladi\n')    p1 = Process(target=insta_sccrape, args=('subyektivuz',))    p2 = Process(target=insta_sccrape, args=('sodiq_school',))    p1.start()    p2.start()    p1.join()    p2.join()    print("Ish Tugatildi!")# multiprocessing || subyektivuz -> 2.059 vaqt davomida ishladi# multiprocessing || sodiq_school -> 1.599 vaqt davomida ishladi